Mucherechedzo uyu unobva kuRosemary (Rosmarinus officinalis Linn.), Chirimwa chinowanikwa mumhuri chakakura muAlps kubvira panguva dzepakati, uye chave kuwanikwa mupasi rose. Rosemary yanga ichishandiswa kwezviuru zvemakore se spice inonaka, inochengetedza chikafu, mune zvekuzora uye zvigadzirwa zvebvudzi, uye semushonga wemakwenzi wehutano hwakasiyana siyana. Kusvika parizvino zvakadaro, chaiyo makemikari nzira dzakabatanidzwa mune zvadzo zvinobatsira zvakaramba zvisingazivikanwe.
