Mulberry mashizha akapfuma mu1-deoxynojirimycin (DNJ), iyo yakakosha pakuchengeta hutano hwakaenzana a-glucosidase. Isu takamboratidza kuti DNJ-yakafuma mulberry shizha dhiza rinodzvinyirira kukwirisa kwepostprandial ropa glucose muvanhu. Chinangwa chechidzidzo ichi chaive chekuongorora mhedzisiro yeDNJ-yakafuma mulberry mashizha mushizha pamaplasma lipid profiles muvanhu. Yakavhurika-chitambi, imwechete-yeboka kudzidza kwakaitiswa mune gumi zvidzidzo zvine yekutan
